import React, { Component } from 'react'
// import HeaderPopup from '../Header/HeaderPopup'
import { TabContext, TabPanel } from '@mui/lab'
import { Button, Box, Tab, Tabs } from '@mui/material'

class Help extends Component {
    constructor(props) {
        super(props)
        this.state = {
            value: '1',
        }
    }
    render() {
        const handleChange = (event, newValue) => {
            this.setState({ value: newValue })
        }
        return (
            <>
                {/*<HeaderPopup />*/}
                <Box sx={{ width: '100%', typography: 'body1' }}>
                    <TabContext value={this.state.value}>
                        <Box
                            sx={{
                                borderBottom: 1,
                                borderColor: 'divider',
                                display: 'flex',
                                justifyContent: 'space-between',
                            }}
                        >
                            <Tabs
                                onChange={handleChange}
                                // textColor="black"
                                TabIndicatorProps={{
                                    sx: {
                                        backgroundColor: '#022454',
                                        height: 4,
                                    },
                                }}
                            >
                                <Tab
                                    sx={{
                                        textTransform: 'none',
                                    }}
                                    label="Documentation"
                                    value="1"
                                />
                                <Tab
                                    sx={{ textTransform: 'none' }}
                                    label="Video"
                                    value="2"
                                />
                            </Tabs>
                            <Button variant="contained">Guide me</Button>
                        </Box>
                        <TabPanel value="1">
                            <span>Creating a Classification tree</span>
                            <div>
                                <span>1. Start with the Root Node</span>
                                <span>
                                    Drag and drop the root node onto the canvas.
                                </span>
                            </div>
                        </TabPanel>
                        <TabPanel value="2">Item Two</TabPanel>
                    </TabContext>
                </Box>
            </>
        )
    }
}

export default Help
